script: |
  super -f text -I q3370.spq | sort > q3370.out

inputs:
  - name: q3370.spq
    data: |
      SELECT ALL - + col2 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col0 / - + 83 * - + 97 BETWEEN - - col2 AND NULL;
  - name: tab2

outputs:
  - name: q3370.out
    data: |
      -23
      -40
      -58
